import * as Styled from './styles'
import img from '../../Images/logonetflix.png'

export const Header = ()=>{


    return(
        <Styled.Header>
            <Styled.Logo>
                <a href="/"><img src={img} alt="" /></a>
            </Styled.Logo>
        </Styled.Header>
    )
}
